  `create_time` datetime(0) DEFAULT NULL COMMENT '创建时间',
  `lng` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '经度',
  `lat` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '纬度',
  `update_time` datetime(0) DEFAULT NULL COMMENT '变更时间',
  `department_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '部门类型（1:内设机构2:办事处3:专业化机构4:园区运营中心）',
  PRIMARY KEY (`id`) USING BTREE
