-- ----------------------------
DROP TABLE IF EXISTS `auth_menu_info`;
CREATE TABLE `auth_menu_info`  (
  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',
  `menu_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '权限code',
  `parent_menu_code` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '父级权限code',
  `status` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '状态，0启用，1停用',
  `url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '请求地址',
  `menu_type` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '权限类型，1分类，2功能，3页面',
  `order_number` int(4) DEFAULT NULL COMMENT '显示顺序',
  `create_user` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '创建者',
  `create_time` datetime(0) DEFAULT NULL COMMENT '创建时间',
  `update_user` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '变更者',
  `update_time` datetime(0) DEFAULT NULL COMMENT '变更时间',
  `remark` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '备注',
  `menu_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单名称',
  `function_type` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '功能类型，如：ADD,DELETE,QUERY,UPDATE等\r\nDISAGREE  驳回\r\nAGREE       同意\r\nCANCEL     取消\r\nCHANGE_HEAD_PORTRAIL  更换头像\r\nURGE        催办\r\nTEST         测试\r\nDELETE     删除\r\nCOLLECTION   收藏\r\nSUBSCRIPTION   订阅\r\nADD         添加\r\nUPDATE    编辑\r\nSUBMIT    提交\r\nDEATIL     查看详情\r\nREST        重置\r\nADD_INTERFACE   新增接口',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `idx_menu_code`(`menu_code`) USING BTREE,
  INDEX `idx_parent_menu_code`(`parent_menu_code`) USING BTREE
) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '权限信息表' ROW_FORMAT = Dynamic;

