-- ----------------------------
-- View structure for department_view
-- ----------------------------
DROP VIEW IF EXISTS `department_view`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `department_view` AS select `a`.`id` AS `id`,`a`.`department_name` AS `department_name`,`a`.`department_code` AS `department_code`,`a`.`parent_department_code` AS `parent_department_code` from `auth_department_info` `a` where (`a`.`parent_department_code` = '1') union select `b`.`id` AS `id`,`a`.`department_name` AS `department_name`,`b`.`parent_department_code` AS `department_code`,`b`.`parent_department_code` AS `parent_department_code` from (`auth_department_info` `a` join `auth_department_info` `b` on((`b`.`parent_department_code` = `a`.`department_code`))) where (`a`.`parent_department_code` = '1');

-- ----------------------------
-- View structure for template_complate_rate
-- ----------------------------
DROP VIEW IF EXISTS `template_complate_rate`;
CREATE ALGORITHM = UNDEFINED DEFINER = `root`@`%` SQL SECURITY DEFINER VIEW `template_complate_rate` AS select `report_data`.`template`.`id` AS `template_id`,`report_data`.`template`.`name` AS `NAME`,if(((to_days(now()) - to_days(`a`.`update_time`)) < `dict`.`dict_sort`),1,0) AS `is_completed` from ((`report_data`.`template` left join `report_data`.`sys_dict_data` `dict` on(((`report_data`.`template`.`fill_in_period` = `dict`.`dict_value`) and (`dict`.`dict_type` = 'FILLIN_PWRIOD')))) left join (select `a`.`template_id` AS `template_id`,`a`.`fill_count` AS `fill_count`,`a`.`update_time` AS `update_time` from (((select `fill`.`template_id` AS `template_id`,max(`fill`.`fill_count`) AS `fill_count` from `report_data`.`table_fill_log` `fill` group by `fill`.`template_id`)) `b` join `report_data`.`table_fill_log` `a` on(((`a`.`template_id` = `b`.`template_id`) and (`a`.`fill_count` = `b`.`fill_count`))))) `a` on((`report_data`.`template`.`id` = `a`.`template_id`))) where (`dict`.`dict_value` <> 'other') union select `report_data`.`template`.`id` AS `template_id`,`report_data`.`template`.`name` AS `NAME`,if((`co`.`number_sum` > 0),1,0) AS `is_completed` from ((`report_data`.`template` left join `report_data`.`sys_dict_data` `dict` on(((`report_data`.`template`.`fill_in_period` = `dict`.`dict_value`) and (`dict`.`dict_type` = 'FILLIN_PWRIOD')))) left join `report_data`.`template_collect` `co` on((`report_data`.`template`.`id` = `co`.`template_id`))) where ((`dict`.`dict_value` = 'other') and (`report_data`.`template`.`is_used` = '0'));

