DROP TRIGGER IF EXISTS `delete_template_collect`;
delimiter ;;
CREATE DEFINER = `root`@`%` TRIGGER `delete_template_collect` AFTER DELETE ON `template` FOR EACH ROW delete from template_collect where number=old.number
;;
delimiter ;

